import React, { useState, useEffect } from 'react'
import { RiFacebookBoxFill, RiInstagramFill, RiTwitterFill } from 'react-icons/ri'
import { GoThreeBars } from 'react-icons/go'
import { AiOutlineCloseCircle } from 'react-icons/ai'
import { Link } from 'react-router-dom'

export default function Navbar(){

    const [click, SetClick] = useState(false)
    const [ width, setWidth ] = useState(window.innerWidth)

    useEffect(() => {
      console.log(width);

    }, [click, width])

    return(
        <>
          <nav className="navbar">
              <ul>
                  <Link to="/facebook"> <RiFacebookBoxFill /> </Link>
                  <Link to="/instagram"> <RiInstagramFill/> </Link>
                  <Link to="/twitter"> <RiTwitterFill/> </Link>
              </ul>
          </nav>
          <div className={click ? "nav-btn-clicked" : "nav-btn"}>
                  <GoThreeBars onClick={() => {SetClick(click => !click)}} />
                  <AiOutlineCloseCircle style={click ? {color: "white", position: "absolute", top:"2%"} : {display: "none"}} />

         </div>
        </>
    )
}
